function Card({ data }) {
  console.log(data);
  return (
    <div className={`card card${data.id}`}>
      <a href={`${data.url}`}>
        <img src={`${data.imageSource}`} alt={`${data.title}`} />
      </a>
    </div>
  );
}

export default Card;
